import Author from './Author';

function Book({ data }) {
  return (
    <section className={`book book${3}`}>
      <header>
        <h1 className='description'>{data.title}</h1>
      </header>
      <div className='book-meta'>
        <div className='description'>
          <p>{data.description}</p>
        </div>
      </div>
      <Author data={data.author} />
    </section>
  );
}

export default Book;
